class TestPlate2 extends THREE.Object3D{
	constructor(){
		super();

		var texdata = "data:image/jpeg;base64,";
		var bumpdata = "data:image/jpeg;base64,";
		var alphadata = "data:image/jpeg;base64,"
		var loader = new THREE.TextureLoader();
		this.loadedTexture;
		this.loadedAlpha;
		this.loadedBump;
		loader.load( texdata, ( texture ) => {
			this.loadedTexture = texture;
			loader.load( bumpdata, ( texture ) => {
				this.loadedBump = texture;
				loader.load( alphadata, ( texture ) => {
					this.loadedAlpha = texture;
					this.create();
				});
			});
		});
		
	}

	create(){
		var geometry = new THREE.PlaneBufferGeometry(256, 256, 128, 128);
		var material = new THREE.MeshPhysicalMaterial( {
				transparent:true,
				map: this.loadedTexture,
				alphaMap: this.loadedAlpha,
				bumpMap: this.loadedBump,
				bumpScale : 5,
				reflectivity:0,
				roughness:0.8,
				displacementMap :this.loadedBump,
				displacementScale : 10
		} );
	
	
		var plate = new THREE.Mesh( geometry, material);
		this.loadedTexture.wrapS = THREE.RepeatWrapping;
    	this.loadedTexture.wrapT = THREE.RepeatWrapping;
		this.loadedTexture.repeat.set(1,1);
		this.loadedTexture.needsUpdate = true;

		this.loadedBump.wrapS = THREE.RepeatWrapping;
    	this.loadedBump.wrapT = THREE.RepeatWrapping;
		this.loadedBump.repeat.set(1,1);
		this.loadedBump.needsUpdate = true;

		this.loadedAlpha.wrapS = THREE.RepeatWrapping;
    	this.loadedAlpha.wrapT = THREE.RepeatWrapping;
		this.loadedAlpha.repeat.set(1,1);
		this.loadedAlpha.needsUpdate = true;

		this.add(plate);
		plate.castShadow = true;
		plate.receiveShadow = true;
	}
}